{
    "Name": "SDK.Demo.NewProcess",
    "PrologProcedure": "#****GENERATED STATEMENTS START****

#****GENERATED STATEMENTS FINISH****

IF (pPrefix @= '');
  ProcessQuit;
ENDIF;

vCubeCount = DIMSIZ('}Cubes');
vIdx = vCubeCount;
WHILE ( vIdx > 0 );
  vCubeName = DIMNM('}Cubes',vIdx);
  IF ( SUBST ( vCubeName, 1, pPrefixLength) @= pPrefix );
    CubeDestroy ( vCubeName );
  ENDIF;
  vIDX = vIDX - 1;
END;

vDimCount = DIMSIZ('}Dimensions');
vIdx = vDimCount;
WHILE ( vIdx > 0 );
  vDimName = DIMNM('}Dimensions',vIdx);
  IF ( SUBST ( vDimName, 1, pPrefixLength) @= pPrefix );
    DimensionDestroy ( vDimName );
  ENDIF;
  vIDX = vIDX - 1;
END;
",
    "Parameters": [
        {
            "Name": "pPrefix",
            "Value": "SDK.",
            "Prompt": "Delete Cubes and Dimensions beginning with pPrefix"
        },
        {
            "Name": "pPrefixLength",
            "Value": 4,
            "Prompt": "Length of pPrefix"
        }
    ]
}

